  input: 'TEXT,F3XA,,"To ensure ''Best Efforts'',  we use a Clear and Conspicuous
    Request thus all solicitations include an accurate and clear statement of the
    law''s requirements for the collection and reporting of the contributor information
    (i.e full name, mailing address, occupation and name of employer).  We use follow-up
    requests within 30 days for all contributors who have contributed over $200  who
    did not provide the FEC required information are identified.  A written follow-up
    request is then sent to the contributors who provided the incomplete information.  All
    follow-up requests to contributors of more than $200 include the following wording:  To
    comply with Federal law, we must use best efforts to obtain, maintain, and submit
    the name, mailing address, occupation, name of employer of individuals whose contributions
    exceed $200 per calendar year. All follow-up requests are sent with a self addressed
    envelope.             The payments from Omega List Company disclosed on Line 17)  represent
    receipts from the rental of our mailing list to certain political organizations.
    We rent our mailing list at ''usual & normal charge'' which we believe is FMV."'
